import './personalDetails.css';
import 'font-awesome/css/font-awesome.min.css';
import image from "../details/image.jpg";
import "../App.css"
//<i className="fa fa-spinner fa-spin">no spinner but why</i>

const PersonalDetails = (props) => 
<div className="container">
<img src={image} width="100" height="50" />
<div className="sideDetails"> 
    <i className="fa fa-user">           {props.details.Name}        </i>
    <i className="fa fa-phone">          {props.details.Phone}       </i>
    <i className="fa fa-envelope-open">  {props.details.Email}       </i>
    <i className="fa fa-birthday-cake">  {props.details.DateOfBirth} </i>
    <i className="fa fa-github">         {props.details.Github}      </i>
</div>;
</div>
export default PersonalDetails;
